import React, { Component } from "react";

export default function NavBar() {
  return (
    <div>
      <ul className="nav-list">
        <li className="nav-link menu"></li>
        <li className="nav-link icon"></li>
        <li className="nav-link theme"></li>
      </ul>
    </div>
  );
}
